import React, { Component } from 'react';
import '../css/navigationPathCategory.css'
import Data from '../Data';

class NavigationLeft extends Component {

    constructor(props) {
        super(props);
        this.state = {
            content: []
        }
      }
      buildContent() {
        let _content = [];
        let cate = Data.cate;
        for(var i in cate) { 
          let href = '/productCateId/' +cate[i].id;
          _content.push(
               
               <li><a href={href}>{cate[i].name}</a><br/></li>
          );
        }
        let _cateContent = [];
        _cateContent.push( <ul className="footer-navigation"><li><b  >Products</b></li><br/><br/>{_content}</ul>);
        return _cateContent;
      }
    
      componentDidMount() {
        this.setState({
            content: this.buildContent()
        });
      } 

  render() {
    return (
        <div className="new-product">
            <div className=" category">
                <h1><b>Product</b></h1>
                <ul className="list-category">
                    <li>Aucostic Guitar</li>
                    <li>Classical Guitar</li>
                    <li>Eletric Guitar</li>
                    <li>Bass Guitar</li>
                    <li>Ukulele</li>
                </ul>
            </div>
            <div className=" category">
                <h1><b>Brands</b></h1>
                <ul>
                    <li>Charvel</li>
                    <li>Cordoba</li>
                    <li>EVH</li>
                    <li>Fender</li>
                    <li>Gretsch</li>
                    <li>Ibanez</li>
                    <li>Jackson</li>
                    <li>Kapok</li>
                    <li>Lazer</li>
                    <li>Roland</li>
                    <li>Samick</li>
                    <li>Sigma</li>
                    <li>Suzuki</li>
                    <li>Takamine</li>
                    <li>Tanglewood</li>
                    <li>Taylor</li>
                </ul>
            </div>
            <div className=" category">
                <h1 ><b>Level</b></h1>
                <ul>
                    <li>Entry level</li>
                    <li>Semi pro</li>
                    <li>Pro level</li>
                </ul>
            </div>
        </div>
    );
  }
}

export default NavigationLeft;
